comp:
float a,b,c;
shader_body
{
//ret = texture(sampler_main,uv).xyz;
vec2 uv2 = uv + 8*texsize.zw*vec2(cos(uv.y*texsize.y*0.4),sin(uv.x*texsize.x*0.4));
    vec3 base = ((texture(sampler_blur3, uv).xyz * scale3) + bias3).x + ((texture(sampler_blur2, uv).xyz * scale2) + bias2).x + ((texture(sampler_blur1, uv2).xyz * scale1) + bias1).x + texture(sampler_main, uv2).x + 0.04;
a =base.x/4;b = base.y/4; c = base.z/4;
c = c + b - c*b;
a = a + c - a*c;
base = 1.4*a;
ret = base*(1-base)*(1-base)*2*vec3(4,2,0) + pow(base,2)*vec3(-0.3,0.2,0.5);
//ret.xy = ret.yx;
ret = mix(ret,1,((texture(sampler_blur1, uv).xyz * scale1) + bias1).z*6);
ret = mix(1-ret,vec3(1,1,-0),texture(sampler_main, uv).xyz.z*0.9);

ret /= vec3(-1.9,-2.7,-1.2);
}

comp_hlsl:
float a,b,c;
shader_body
