    float3 base = GetBlur3(uv).x + GetBlur2(uv).x + GetBlur1(uv2).x + tex2D(sampler_main, uv2).x + 0.04;
a =base.x/4;b = base.y/4; c = base.z/4;
c = c + b - c*b;
a = a + c - a*c;
base = 1.4*a;
ret = base*(1-base)*(1-base)*2*float3(4,2,0) + pow(base,2)*float3(-0.3,0.2,0.5);
//ret.xy = ret.yx;
